import { FC, useEffect } from 'react';
import { useParams } from 'react-router-dom';

type propTypes = {
    setBreadcrumb: Function
}

const Question: FC<propTypes> = ({setBreadcrumb}) => {
    useEffect(() => {
        setBreadcrumb(['Question', 'How to set a custom ringtone on your Nokia 3310?'])
    }, []);

    const {id}: {id: string} = useParams();

    return <div>Parameter: {id}</div>
}

export default Question;
